class wp_horoscope {



    function horoscope_init() {

    	$class_name = 'wp_horoscope';

    	$calc_title = 'Daily Horoscope';

		$calc_credit = 0;

    	$calc_desc = 'Your daily horoscope.';



    	if (!function_exists('wp_register_sidebar_widget')) return;



    	wp_register_sidebar_widget(

    		$class_name,

    		$calc_title,

    		array($class_name, 'horoscope_widget'),

            array(

            	'classname' => $class_name,

            	'description' => $calc_desc

            )

        );



    	wp_register_widget_control(

    		$class_name,

    		$calc_title,

    		array($class_name, 'horoscope_control'),

    	    array('width' => '100%')

        );



        add_shortcode(

        	$class_name,

        	array($class_name, 'horoscope_shortcode')

        );

    }



    function horoscope_display($is_widget, $args=array()) {

    	if($is_widget){

    		extract($args);

			$options = get_option('wp_horoscope');

			$title = $options['title'];

			$credit = $options['credit'];

			if ($credit == 1) $displayCase = '<li class="zodiacHead"><a id="zodiacUrl">&nbsp;</a></li>';
			else $displayCase = '<li id="zodiacUrl" style="font-weight:bold; text-align:center;">&nbsp;</li>';

			$output[] = $before_widget . $before_title . $title . $after_title;

		}



		$zodiacXml = simplexml_load_file("http://hitrusha.com/get_daily_zodiac.xml", 'SimpleXMLElement',LIBXML_NOCDATA);

		foreach ($zodiacXml->zodiac as $index => $zodiac) {

			$starsCase .= 'stars['.$zodiac->id.'][0]="'. $zodiac->health .'"; ';

			$starsCase .= 'stars['.$zodiac->id.'][1]="'. $zodiac->love .'"; ';

			$starsCase .= 'stars['.$zodiac->id.'][2]="'. $zodiac->job .'"; ';

			$starsCase .= 'stars['.$zodiac->id.'][3]="'. $zodiac->contacts .'"; ';

			$starsCase .= 'stars['.$zodiac->id.'][4]="'. $zodiac->lucky .'"; ';
			
			$starsCase .= 'sign['.$zodiac->id.']="'. $zodiac->name .'"; ';
			
			if ($credit == 1) $starsCase .= 'url['.$zodiac->id.']="'. $zodiac->url .'"; ';
			else $starsCase .= 'url['.$zodiac->id.']=""; ';

			}



		$output[] = '



		<div style="margin-top:5px;">

		<style>

			.dailyStars ul { list-style: none; margin: 0; padding: 0; clear:both; float:left;}

			.dailyStars ul li { clear:both; }

			.dailyStars ul li label { float:left; width:56px; color:#00968c; font-size:11px; margin:2px 0;}

			.dailyStars ul li span { background:transparent url(data:image/gif;base64,R0lGODlhEAANAKIAANfX1+/v797e3vf39+bm5v///////wAAACH5BAEHAAYALAAAAAAQAA0AAANHaLo2w5ANIF6ERAhyWQDBZ0GBRhWDQAnB8gFEMBRoQADgospO/3GLFKg3+FQgKVaodERSCNBMU0LBrQAjF05pzSoGsaCNkQAAOw%3D%3D) repeat-x; display:block; float:left; position:relative; width:80px; margin:3px 0;}

			.dailyStars ul li span em { background:transparent url(data:image/gif;base64,%3D%3D) repeat-x; display:block; height:13px; width:1px;}

			.dailyStars ul li span em.s1 {width:16px;}

			.dailyStars ul li span em.s2 {width:32px;}

			.dailyStars ul li span em.s3 {width:48px;}

			.dailyStars ul li span em.s4 {width:64px;}

			.dailyStars ul li span em.s5 {width:80px;}

			.zodiacMap { float:left; display:block; margin-top:8px; margin-bottom:10px; margin-left:5px; background: url(data:image/png;base64,) no-repeat; width:150px; height:190px; }

			#zodiacMap { width:150px; height:190px; }

			div#date2{ text-align:center; font-weight:bold; color: #fff; clear:both; background-color:#999; text-shadow:none; }
			
			li.zodiacHead { margin-top:5px; margin-bottom:5px; }

			

		</style>

	<table><tr><td>

	<div class="zodiacMap" id="zodiacMapDiv">

	<img src="data:image/gif;base64,%3D" title="zodiac" id="zodiacMap" usemap="#zodiacMap" />

	<map name="zodiacMap">

		<area shape="rect" coords="0,0,49,47" href="#" onclick="return setZodiac(1);" id="z1">

		<area shape="rect" coords="50,0,99,47" href="#" onclick="return setZodiac(2);" id="z2">

		<area shape="rect" coords="100,0,149,47" href="#" onclick="return setZodiac(3);" id="z3">

		<area shape="rect" coords="0,48,49,95" href="#" onclick="return setZodiac(4);" id="z4">

		<area shape="rect" coords="50,48,99,95" href="#" onclick="return setZodiac(5);" id="z5">

		<area shape="rect" coords="100,48,149,95" href="#" onclick="return setZodiac(6);" id="z6">

		<area shape="rect" coords="0,96,49,142" href="#" onclick="return setZodiac(7);" id="z7">

		<area shape="rect" coords="50,96,99,142" href="#" onclick="return setZodiac(8);" id="z8">

		<area shape="rect" coords="100,96,149,142" href="#" onclick="return setZodiac(9);" id="z9">

		<area shape="rect" coords="0,143,49,190" href="#" onclick="return setZodiac(10);" id="z10">

		<area shape="rect" coords="50,143,99,190" href="#" onclick="return setZodiac(11);" id="z11">

		<area shape="rect" coords="100,143,149,190" href="#" onclick="return setZodiac(12);" id="z12">

	</map>

	</div>

	

	<div id="date2"></div>

	

	<div class="dailyStars">

      <ul>
	  
		'.$displayCase.'
	  
        <li><label>Health</label><span><em id="e1" class="s0" title="health">&nbsp;</em></span></li>

        <li><label>Love</label><span><em id="e2" class="s0" title="love">&nbsp;</em></span></li>

        <li><label>Job</label><span><em id="e3" class="s0" title="job">&nbsp;</em></span></li>

        <li><label>Contacts</label><span><em id="e4" class="s0" title="contacts">&nbsp;</em></span></li>

        <li><label>Lucky</label><span><em id="e5" class="s0" title="lucky">&nbsp;</em></span></li>

      </ul>

    </div>

	

			<script type="text/javascript">

			

			var dt = new Date();

			var txtDate = dt.getFullYear() + "/" + (dt.getMonth() + 1) + "/" + dt.getDate();

			elm("date2").innerHTML = txtDate;



			

			var stars = new Array(14);
			var sign = new Array(14);
			var url = new Array(14);

			for (var i = 0; i < 14; i++) {

				stars[i] = new Array(5);

				}

			

			'.$starsCase.'

			

			function elm(obj) {

				var theObj;

				if(document.all){

					if(typeof obj=="string"){

						return document.all(obj);

					}else{

						return obj.style;

					}

				}

				if(document.getElementById){

					if(typeof obj=="string"){

						return document.getElementById(obj);

					}else{

						return obj.style;

					}

				}

				return null;

			}

			

			function getCookie(c_name){

				var i,x,y,ARRcookies=document.cookie.split(";");

				for (i=0;i<ARRcookies.length;i++){

					x=ARRcookies[i].substr(0,ARRcookies[i].indexOf("="));

					y=ARRcookies[i].substr(ARRcookies[i].indexOf("=")+1);

					x=x.replace(/^\s+|\s+$/g,"");

					if (x==c_name){

						return unescape(y);

						}

					}

				return false;

				}

			

			function setCookie(c_name,value,exdays){

				var exdate=new Date();

				exdate.setDate(exdate.getDate() + exdays);

				var c_value=escape(value) + ((exdays==null) ? "" : "; expires="+exdate.toUTCString());

				document.cookie=c_name + "=" + c_value;

				}

			

			function setZodiac(z){

				var y;

				y = (z - 1)*(-190);

				elm("zodiacMapDiv").style.backgroundPosition="0px "+y+"px";



				elm("e1").setAttribute("class", "s"+stars[z][0]);

				elm("e2").setAttribute("class", "s"+stars[z][1]);

				elm("e3").setAttribute("class", "s"+stars[z][2]);

				elm("e4").setAttribute("class", "s"+stars[z][3]);

				elm("e5").setAttribute("class", "s"+stars[z][4]);
				
				if (url[z] != "") {
				
					elm("zodiacUrl").innerHTML = "Read " + sign[z] + " daily horoscope forecast »";
				
					elm("zodiacUrl").setAttribute("title",  "Read " + sign[z] + " daily horoscope forecast");
				
					elm("zodiacUrl").setAttribute("href", url[z]);
					
					}
					
				else {
					elm("zodiacUrl").innerHTML = sign[z] ;
					// in this case is LI
					}


				setCookie("zodiac",z,100);



				return false;

				}

					

			

			var z=getCookie("zodiac"); 



			if(z) {

				setZodiac(z);

				}				

			else {

				setZodiac(1);

				}

			

			</script>

			</td>

		</tr>

		</table>

		</div>

		';



    	$output[] = $after_widget;

    	return join($output, "\n");

    }



	function horoscope_control() {

		$class_name = 'wp_horoscope';

		$calc_title = 'Daily Horoscope';

		$calc_credit = 0;



	    $options = get_option($class_name);



		if (!is_array($options)) $options = array('title'=>$calc_title,'credit'=>$calc_credit);



		if ($_POST[$class_name.'_submit']) {

			$options['title'] = strip_tags(stripslashes($_POST[$class_name.'_title']));

			$options['credit'] = strip_tags(stripslashes($_POST[$class_name.'_credit']));

			update_option($class_name, $options);

		}



		$title = htmlspecialchars($options['title'], ENT_QUOTES);

		$credit = htmlspecialchars($options['credit'], ENT_QUOTES);

		if ($credit == "1") $defaultChecked = "checked='checked'"; else $defaultChecked="";



		echo '<p>Title: <input style="width: 180px;" name="'.$class_name.'_title" type="text" value="'.$title.'" /></p>';

		echo '<p><input name="'.$class_name.'_credit" type="checkbox" '.$defaultChecked.' value="1" /> Display link to customer daily horoscope.</p>';
		
		if ($credit != "1") echo "<p style='color:#f00;'>Outside links need to be enabled for the plugin to work properly. If they're not, the customers can't read the forecast.</p>";

		echo '<input type="hidden" name="'.$class_name.'_submit" value="1" />';

	}



    function horoscope_shortcode($args, $content=null) {

        return wp_horoscope::horoscope_display(false, $args);

    }



    function horoscope_widget($args) {

        echo wp_horoscope::horoscope_display(true, $args);

    }

}



add_action('widgets_init', array('wp_horoscope', 'horoscope_init'));



?>